import React, { Component } from 'react'
import styled from 'styled-components'

const StyledNav = styled.div`
  text-align: right;
  li {
    display: inline-flex;
    padding: 20px;
    margin-right: 50px;
  }
  a {
    text-decoration: none;
    color: black
  }
  ul {
    text-align: right;
  }
  h1 < li {
    text-align: right;
  }
`

const StyledH1 = styled.h1`
  text-align: left;
  display: inline;
  color: #ff0000;
`

class Nav extends Component {
  render() {
    return (
      <div>
        <StyledNav>
          <ul>
            <StyledH1>super rad</StyledH1>
            <li><a href="/">sign in</a></li>
            <li><a href="/">blah</a></li>
            <li><a href="">blah</a></li>
          </ul>
      </StyledNav>
    </div>
    )
  }
}

export default Nav;
